import SideNav from "../SideNav";
import Header from "../Header";
import React from "react";

import "./DefaultLayout.css";

const DefaultLayout = (props) => {
  const [openMenu, setOpenMenu] = React.useState("false");

  console.log(window["detectMob"], window["detectMob"]());

  return (
    <div className="sa-dl-w">
      {window["detectMob"]() ? (
        openMenu ? (
          <div className="sa-dl-left">
            <SideNav isLoggedIn={props.userType} userName={props.userName} />
          </div>
        ) : null
      ) : (
        <div className="sa-dl-left">
          <SideNav isLoggedIn={props.userType} userName={props.userName} />
        </div>
      )}
      <div className="sa-dl-right">
        <Header setUserType={props.setUserType.bind(this)} />
        <div className="sa-dl-right-content">{props.children}</div>
      </div>
    </div>
  );
};

export default DefaultLayout;
